import unittest
import requests

class TestUserAuth(unittest.TestCase):
    BASE_URL = "http://localhost:9900"
    admin_email = "111@gmail.com"
    admin_password = "111"
    user_email = "123@gmail.com"
    user_password = "123"
    admin_token = None
    user_token = None

    def test_user_workflow(self):
        """Test the complete workflow: Register, Login, and Delete User"""

        # Step 1: Register
        print("Step 1: Registering user...")
        register_response = requests.post(f"{self.BASE_URL}/user/auth/register", json={
            "email": "testuser@gmail.com",
            "password": "password123",
            "name": "Test User",
            "is_admin": False
        })
        self.assertEqual(register_response.status_code, 200, "Registration failed.")
        register_data = register_response.json()
        self.assertIn("token", register_data, "Registration response missing token.")
        print("Registration complete.")

        # Step 2: Login
        print("Step 2: Logging in user...")
        login_response = requests.post(f"{self.BASE_URL}/user/auth/login", json={
            "email": "testuser@gmail.com",
            "password": "password123"
        })
        self.assertEqual(login_response.status_code, 200, "Login failed.")
        login_data = login_response.json()
        self.assertIn("token", login_data, "Login response missing token.")
        token = login_data["token"]
        print("Login complete.")

        # Step 3: Delete User
        print("Step 3: Deleting user...")
        delete_response = requests.delete(f"{self.BASE_URL}/user", headers={
            "Authorization": f"Bearer {token}"
        })
        self.assertEqual(delete_response.status_code, 200, "User deletion failed.")
        print("User deletion complete.")

    def test_brand_and_product_workflow(self):
        """Test the complete workflow: Register, Login, and Delete User"""
        # Step 1: Admin Login
        print("Step 1: Logging in as admin...")
        admin_login_response = requests.post(f"{self.BASE_URL}/user/auth/login", json={
            "email": self.admin_email,
            "password": self.admin_password
        })
        self.assertEqual(admin_login_response.status_code, 200, "Admin login failed.")
        admin_login_data = admin_login_response.json()
        self.assertIn("token", admin_login_data, "Admin login response missing token.")
        self.admin_token = admin_login_data["token"]
        print("Admin login complete.")

        # Step 2: Add Brand
        print("Step 2: Adding a new brand...")
        brand_data = {
            "name": "Test Brand",
            "description": "This is a test brand.",
            "logo": ""
        }
        add_brand_response = requests.post(f"{self.BASE_URL}/admin/brands", json=brand_data, headers={
            "Authorization": f"Bearer {self.admin_token}"
        })
        self.assertEqual(add_brand_response.status_code, 200, "Failed to add brand.")
        added_brand = add_brand_response.json()
        brand_id = added_brand["brand_id"]
        print(f"Brand added successfully: {brand_id}")

        # Step 3: Add Product
        print("Step 3: Adding a new product...")
        product_data = {
            "name": "Test Product",
            "price": "100.0",
            "previous_price": "120.0",
            "main_category": "mens-clothing",
            "sub_category": "shirts",
            "colour": "blue",
            "brand_id": "354117646",
            "product_url": "https://example.com/test-product",
            "status": "Old",
            "stock": "In Stock",
            "size": ["M:1", "L:1"]
        }
        add_product_response = requests.post(f"{self.BASE_URL}/admin/products", json=product_data, headers={
            "Authorization": f"Bearer {self.admin_token}"
        })
        self.assertEqual(add_product_response.status_code, 200, "Failed to add product.")
        added_product = add_product_response.json()
        product_id = added_product["product_id"]
        print(f"Product added successfully: {product_id}")

        # Step 4: Edit Product
        print("Step 4: Editing the product...")
        updated_product_data = product_data.copy()
        updated_product_data["price"] = 80.0  # Updating the price
        edit_product_response = requests.put(f"{self.BASE_URL}/admin/products/{product_id}", json=updated_product_data, headers={
            "Authorization": f"Bearer {self.admin_token}"
        })
        self.assertEqual(edit_product_response.status_code, 200, "Failed to edit product.")
        print("Product edited successfully.")

        # Step 5: Delete Product
        print("Step 5: Deleting the product...")
        delete_product_response = requests.delete(f"{self.BASE_URL}/admin/products/{product_id}", headers={
            "Authorization": f"Bearer {self.admin_token}"
        })
        self.assertEqual(delete_product_response.status_code, 200, "Failed to delete product.")
        print("Product deleted successfully.")

        # Step 6: Delete Brand
        print("Step 6: Deleting the brand...")
        delete_brand_response = requests.delete(f"{self.BASE_URL}/admin/brands/{brand_id}", headers={
            "Authorization": f"Bearer {self.admin_token}"
        })
        self.assertEqual(delete_brand_response.status_code, 200, "Failed to delete brand.")
        print("Brand deleted successfully.")

if __name__ == '__main__':
    unittest.main()
